const Main = (props) => {
  return (
    <div className="main">
      <DemoState name="Demo state 2" />
      <hr></hr>
      <Table />
      <hr></hr>
      <DemoForm />

      <ShareDataDemo />
    </div>
  );
};

export default Main;
